from typing import List
from collections import deque

class Solution:
    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
        rows = len(mat)
        cols = len(mat[0])
        res = [[0 for _ in range(cols)] for _ in range(rows)]
        dq = deque()
        seen = set()
        for r in range(rows):
            for c in range(cols):
                if mat[r][c] == 0:
                    dq.append((r, c))
                    seen.add((r, c))
        directions = [[0,1],[1,0],[0,-1],[-1,0]]
        step = 1
        while dq:
            size = len(dq)
            for _ in range(size):
                row, col = dq[0]
                for dr, dc in directions:
                    nrow = row + dr
                    ncol = col + dc
                    if 0 <= nrow < rows and 0 <= ncol < cols:
                        if (nrow, ncol) not in seen:
                            seen.add((nrow, ncol))
                            dq.append((nrow, ncol))
                            if mat[nrow][ncol] == 1:
                                res[nrow][ncol] = step
                dq.popleft()
            step += 1
        return res

